const csv = require('csv-parser');
const fs = require('fs-extra');

const NAME = 'Name';
let l = [];
const lss = fs.createReadStream('states-list.csv')
.pipe(csv())
.on('data', (row) => {
    l.push(row[NAME]);
})
    .on('end', () => {
    console.log('Successfully loaded states...');
    module.exports = l;
});

console.log(lss);
